import react from "react"
import styled from "styled-components"
import img from "../images/1.png"
const Video = ({ video }) => {

    return (
        <OneVideo>
            < div className='img'>
                <img src={video.snippet.thumbnails.high.url} />
            </div>
            <div className="title">
                <span>{video.snippet.title}</span>

            </div>
            <span className='description'>
                trying to build the yputbe clone hopefully it works out
            </span>
            <div className="channel">
                < div className='channelimg'>
                    <img src={img} />
                </div>
                <span>{video.snippet.channelTitle}</span>
            </div>
        </OneVideo>
    )
}

export default Video

const OneVideo = styled.div`
width: 100%;
height: 35vh;
margin: 10px 10px;
color: white;
font-family: Arial;
.img {
    width: 100%;
    height: 20vh;
    overflow: hidden;
    img {
        width:100%;
    }
}
.title {
    font-size: 13px;
    font-weight: 900;
    margin-left: 10px;
}
.description {
    margin-left: 10px;
    margin-bottom: 10px;
    font-size: 11px;
    
}
.channel {
    margin-top: 10px;
    display: flex;
    align-items: center;

    .channelimg {
        width: 15%;
        height: 4vh;
        overflow: hidden;
        border-radius: 50%;
        margin: 0px 10px;
        img{
            width: 100%;
        }
    }
    span {
        font-size: 14px;
        letter-spacing: 1px;
    }
}
`
